import React from 'react';
import { Button } from 'react-bootstrap';
import './FloatingButton.css';

function BotonFlotante() {
    const handleCrearProductoClick = () => {
      // Aquí se redirige al usuario a la página de creación de productos
      history.push('/crearProducto');
    }

    return (
      <div>
        <Link to='/crearProducto' className='btn btn-primary mt-5 mb-3'><i className="fa-solid fa-plus"></i> Agregar Producto</Link>
        <button className="floating-button" onClick={handleCrearProductoClick}>
          <i className="fa-solid fa-plus"></i>
        </button>
      </div>
    );
  }
export default FloatingButton;
